/*======================================================================
| MAP DEFINITIONS FOR ZAC-RELATED PROJECTS
+-----------------------------------------------------------------------
| Description: Contains map definitions that I want to 'save' for future 
|              use, which are currently realized as 2D arrays; alongside
|              a 1D array for some maps indicating map cell coordinates
|              for where to create and place agents. The current process
|              for saving maps involves (1) calling the TileMap instance 
|              method <mapToString> which outputs a string encompassing
|              the map tile definition (2) placing the string into a <p>
|              element below the canvas as to copy this string manually,
|              and (3) manually pasting it into this file.
| Why Not Txt? Yes, reading/writing to text files would be a hell of a
|              lot easier; and believe me I'd prefer them to this. But
|              I'm doing this 'Carlos Scheidegger CSC 444/544 Style' for
|              the same reasons he did: avoid the need of setting up a 
|              local server in order to read/write, due to most (all?)
|              browsers having an issue vis-a-vis CORS policy. Suffice
|              it to say: if I ever get to implement ZAC in Unity3D or
|              some other game engine / non-webstack language/library:
|              you bet your ass I'll be using txts or serialized files.
| Format Info: > Name Maps as {map_<rows>x<cols>_##}, where...
|                - <rows> and <cols> are the number of rows and columns
|                  of the map, expressed as integers; and
|                - ## is the map number/ID, such that it is a two digit 
|                  integer which has NOT yet been used for another map
|              > Name Agents as {agt_<rows>x<cols>_##}, where...
|                - <rows> and <cols> are the same as with maps; and
|                - ## is the map number of the map the agents belong to
|              > Define Agents within an array as [row,col] map cells.
+=====================================================================*/

//>>> Description: Use this function to convert maps of int val form into [proper] char form. Should be obsolete but keeping JIC
function intMapToCharMap(mapArr,rows,cols,pElementID){var rBuff = ""; for(let r=0; r<rows; r++){rBuff = ""; for(let c=0; c<cols; c++){rBuff += "\'"+TileType.valToString(map_48x64_02[r][c])[0].toLowerCase() +"\',";} select("#"+pElementID).html(rBuff+"<br>",true);}}

